import React from 'react';
import classes from './TopBar.module.css';
import NavItem from '../NavItem/NavItem';

const topBar = () => (
	<div className={classes.TopBar} >
		<ul className={classes.Left} >
			<NavItem></NavItem>
			<li>Sitemap</li>
			<li>Contact Us</li>
		</ul>
		<ul className={classes.Right} >
			<li>English</li>
			<li>Wishlist</li>
			<li>Compare</li>
		</ul>
	</div>
);

export default topBar;
